Build a Rust program that calculates the sum of all even integers between two given numbers. The numbers are read from the user. The program should be able to handle any positive integer input. The program should also handle any negative integer input, and in this case, the program should print out a message saying that the input is invalid.
This program uses a while loop to iterate through the integers from 0 to the user input. It uses the modulo operator (%) to check if the number is even or odd. If the number is even, it adds it to the sum variable. If the number is odd, it skips it. After the loop, the program prints out the sum of all even integers.
